script: |
  super -f text -I q6001.spq | sort > q6001.out

inputs:
  - name: q6001.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) cor0 WHERE 78 + col2 NOT BETWEEN + - 65 * + - 97 * + col0 * + 16 + - col2 AND + col2 * + CAST ( NULL AS REAL ) - + 74 * col1;
  - name: tab1

outputs:
  - name: q6001.out
    data: |
      51	14	96
      85	5	59
      91	47	68
